import './css/App.css';
import "./css/nullstyle.css";
import MainScreen from './js-components/Mainscreen/main-screen';

function App(props) {
	// console.log(props)

	return (
		<div className="wrapper">
			<div className="content">
				<MainScreen appProps={props}/>
			</div>
		</div>
	);
}

export default App;
